1	Consumo Estándar	Fórmula básica para la mayoría de determinaciones: (volumen + reactivo) * cantidad	{"type": "expression", "unit": "mL", "variables": {"volume_per_test": {"type": "decimal", "source": "catalog_determinations.volume_per_test", "default": 0.0}, "monthly_quantity": {"type": "integer", "source": "bc_determinations.monthly_quantity", "required": true}, "reagent_consumption": {"type": "decimal", "source": "catalog_determinations.reagent_consumption", "default": 0.0}}, "expression": "(volume_per_test + reagent_consumption) * monthly_quantity", "description": "Consumo total de reactivos"}	General	["volume_per_test", "reagent_consumption", "monthly_quantity"]	{"volume_per_test": 0.180, "monthly_quantity": 1000, "reagent_consumption": 0.250}	430.0000	\N	2025-12-05 10:08:04.359409-05	2025-12-05 10:08:04.359409-05	1.0	t
2	Consumo con Lavados	Incluye ciclos de lavado en el cálculo: (volumen + reactivo + lavados*0.5) * cantidad	{"type": "expression", "unit": "mL", "variables": {"wash_cycles": {"type": "integer", "source": "catalog_determinations.wash_cycles", "default": 0}, "volume_per_test": {"type": "decimal", "source": "catalog_determinations.volume_per_test", "default": 0.0}, "monthly_quantity": {"type": "integer", "source": "bc_determinations.monthly_quantity", "required": true}, "reagent_consumption": {"type": "decimal", "source": "catalog_determinations.reagent_consumption", "default": 0.0}}, "expression": "(volume_per_test + reagent_consumption + (wash_cycles * 0.5)) * monthly_quantity"}	Química Clínica	["volume_per_test", "reagent_consumption", "wash_cycles", "monthly_quantity"]	\N	\N	\N	2025-12-05 10:08:04.359409-05	2025-12-05 10:08:04.359409-05	1.0	t
3	Descuento por Volumen	Aplica descuentos según cantidad: >1000 = 10%, >500 = 5%	{"type": "conditional", "unit": "mL", "rules": [{"formula": "((volume_per_test + reagent_consumption) * monthly_quantity) * 0.90", "condition": "monthly_quantity > 1000"}, {"formula": "((volume_per_test + reagent_consumption) * monthly_quantity) * 0.95", "condition": "monthly_quantity > 500"}, {"formula": "(volume_per_test + reagent_consumption) * monthly_quantity", "condition": "true"}], "variables": {"volume_per_test": {"type": "decimal", "source": "catalog_determinations.volume_per_test"}, "monthly_quantity": {"type": "integer", "source": "bc_determinations.monthly_quantity"}, "reagent_consumption": {"type": "decimal", "source": "catalog_determinations.reagent_consumption"}}}	Química Clínica	[]	\N	\N	\N	2025-12-05 10:08:04.359409-05	2025-12-05 10:08:04.359409-05	1.0	t
4	Con Factor de Seguridad 10%	Añade 10% de margen de seguridad al consumo calculado	{"type": "expression", "unit": "mL", "variables": {"volume_per_test": {"type": "decimal", "source": "catalog_determinations.volume_per_test"}, "monthly_quantity": {"type": "integer", "source": "bc_determinations.monthly_quantity"}, "reagent_consumption": {"type": "decimal", "source": "catalog_determinations.reagent_consumption"}}, "expression": "((volume_per_test + reagent_consumption) * monthly_quantity) * 1.10"}	General	[]	\N	\N	\N	2025-12-05 10:08:04.359409-05	2025-12-05 10:08:04.359409-05	1.0	t
5	Cálculo en Pipeline	Cálculo paso a paso con factores intermedios	{"type": "pipeline", "steps": [{"name": "calcular_base", "output": "consumo_base", "formula": "volume_per_test * monthly_quantity"}, {"name": "agregar_reactivo", "output": "consumo_con_reactivo", "formula": "consumo_base + (reagent_consumption * monthly_quantity)"}, {"name": "agregar_lavados", "output": "consumo_total", "formula": "consumo_con_reactivo + (wash_cycles * 0.5 * monthly_quantity)"}, {"name": "aplicar_factor_seguridad", "output": "consumo_final", "formula": "consumo_total * 1.1"}], "variables": {"wash_cycles": {"source": "catalog_determinations.wash_cycles", "default": 0}, "volume_per_test": {"source": "catalog_determinations.volume_per_test"}, "monthly_quantity": {"source": "bc_determinations.monthly_quantity"}, "reagent_consumption": {"source": "catalog_determinations.reagent_consumption"}}, "final_output": "consumo_final"}	Avanzado	[]	\N	\N	\N	2025-12-05 10:08:04.359409-05	2025-12-05 10:08:04.359409-05	1.0	t
